import React from "react";

const Text1 = () => {
  return (
    <>
      <h1>우리 어디가냐고!?</h1>
      <p>
        가입 하셨나요? <br /> 진짜 가입 하셨나요?
        <br /> 거짓말 하지 말고 제발 가입하세요 <br />
        제발!
      </p>
    </>
  );
};

export default Text1;
